import { Modal } from "antd";
import React from "react";


const DuyetDialog = (props) => {

    const { open, onCancel, idDuyet, onOK } = props

    const handleOk = async () => {
        console.log("nhan nut ok")
        await onOK()
    }

    return (
        <Modal
            open={open}
            onOk={handleOk}
            onCancel={onCancel}
        >
            <p>Ban co chac chan muon duyet don {idDuyet}</p>
        </Modal>
    )
}

export default DuyetDialog
